package co.fin.core.kjh.companyuser.vo;

public class CompanyUserVo {
	private String company_user_id;
	private String company_user_pw;
	private int company_no;
	private String company_user_auth;
	private String company_profile;
	
	public CompanyUserVo() {
		// TODO Auto-generated constructor stub
	}

	public String getCompany_user_id() {
		return company_user_id;
	}

	public void setCompany_user_id(String company_user_id) {
		this.company_user_id = company_user_id;
	}

	public String getCompany_user_pw() {
		return company_user_pw;
	}

	public void setCompany_user_pw(String company_user_pw) {
		this.company_user_pw = company_user_pw;
	}

	public int getCompany_no() {
		return company_no;
	}

	public void setCompany_no(int company_no) {
		this.company_no = company_no;
	}

	public String getCompany_user_auth() {
		return company_user_auth;
	}

	public void setCompany_user_auth(String company_user_auth) {
		this.company_user_auth = company_user_auth;
	}

	public String getCompany_profile() {
		return company_profile;
	}

	public void setCompany_profile(String company_profile) {
		this.company_profile = company_profile;
	}

	
	
	

}
